tables.table_schema:
CREATE TABLE rich_snippets (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    description TEXT,
    price DECIMAL(10, 2)
);

CREATE TABLE search_results (
    id INT PRIMARY KEY,
    title VARCHAR(255),
    url VARCHAR(255),
    snippet TEXT
);

CREATE TABLE metadata (
    id INT PRIMARY KEY,
    snippet_id INT,
    result_id INT,
    created_at TIMESTAMP
);
